INSERT INTO `v1_4942e948b592abd6a511e5b4b3370f14788000c77ecafa831ddb5eefc34de736` VALUES (4, 1, 4, 24015, 24, 10021, 0.0, 0.0, 110501, "2030/12/17 14:59:59", 0.0, "カオリ（サマー）", "2019/07/31 12:00:00", "あうぅ～残念さ～\nマジムンに魂を\n奪われちゃったかな～？");
INSERT INTO `v1_4942e948b592abd6a511e5b4b3370f14788000c77ecafa831ddb5eefc34de736` VALUES (4, 2, 1, 24016, 24, 10021, 4.0, 0.0, 110501, "2030/12/17 14:59:59", 0.0, "カオリ（サマー）", "2019/07/31 12:00:00", "今日は踊りのキレも悪いよ～\nゴーヤーっぽいもの食べて、元気回復さ～！");
INSERT INTO `v1_4942e948b592abd6a511e5b4b3370f14788000c77ecafa831ddb5eefc34de736` VALUES (4, 3, 4, 24017, 24, 10021, 0.0, 0.0, 110501, "2030/12/17 14:59:59", 0.0, "カオリ（サマー）", "2019/07/31 12:00:00", "マジムンだらけで目が回るさ～！\nふらふらさ～！");
INSERT INTO `v1_4942e948b592abd6a511e5b4b3370f14788000c77ecafa831ddb5eefc34de736` VALUES (1, 4, 2, 24018, 24, 10021, 5.2, 0.0, 110501, "2030/12/17 14:59:59", 0.0, "カオリ（サマー）", "2019/07/31 12:00:00", "なんくるない、なんくるない\n次、頑張ればいいんだよ～！\n海で泳いで\nリフレッシュするさー！");
INSERT INTO `v1_4942e948b592abd6a511e5b4b3370f14788000c77ecafa831ddb5eefc34de736` VALUES (5, 5, 6, 24019, 24, 10021, 4.2, 0.0, 110501, "2030/12/17 14:59:59", 0.0, "カオリ（サマー）", "2019/07/31 12:00:00", "恥ずかしいところ\n見られちゃったね～\n水着？　水着のことじゃないよー？");
INSERT INTO `v1_4942e948b592abd6a511e5b4b3370f14788000c77ecafa831ddb5eefc34de736` VALUES (2, 6, 2, 24020, 24, 10021, 0.0, 0.0, 110501, "2030/12/17 14:59:59", 0.0, "カオリ（サマー）", "2019/07/31 12:00:00", "絶好調さ～！　この調子で\n海の平和を取り戻すよ～！\n楽しい夏が待ってるさ～！");
INSERT INTO `v1_4942e948b592abd6a511e5b4b3370f14788000c77ecafa831ddb5eefc34de736` VALUES (1, 7, 6, 24021, 24, 10021, 6.4, 0.0, 110501, "2030/12/17 14:59:59", 0.0, "カオリ（サマー）", "2019/07/31 12:00:00", "何匹で襲ってきたって\n私はマブイを落っことさないよ～！\nくしゅん！　あ……\n今のくしゃみで落っこちたかも～？");
INSERT INTO `v1_4942e948b592abd6a511e5b4b3370f14788000c77ecafa831ddb5eefc34de736` VALUES (2, 8, 2, 24022, 24, 10021, 0.0, 0.0, 110501, "2030/12/17 14:59:59", 0.0, "カオリ（サマー）", "2019/07/31 12:00:00", "ひーやーさーさー♪\n戦いの後は、踊りを踊って\n気分スッキリさ～！");
INSERT INTO `v1_4942e948b592abd6a511e5b4b3370f14788000c77ecafa831ddb5eefc34de736` VALUES (6, 9, 3, 24023, 24, 10021, 10.08, 0.0, 110501, "2030/12/17 14:59:59", 0.0, "カオリ（サマー）", "2019/07/31 12:00:00", "あれ～？　戦ってるうちに\n水着がどっか行っちゃった～？\nねぇキミ、どっかで見なかった～？\nなんで離れるさ～？");
INSERT INTO `v1_4942e948b592abd6a511e5b4b3370f14788000c77ecafa831ddb5eefc34de736` VALUES (1, 10, 2, 24024, 24, 10021, 5.0, 0.0, 110501, "2030/12/17 14:59:59", 0.0, "カオリ（サマー）", "2019/07/31 12:00:00", "まだまだ私は元気だよ～！\nマジムンでもなんでも、\nどんとこーいさー♪");
INSERT INTO `v1_4942e948b592abd6a511e5b4b3370f14788000c77ecafa831ddb5eefc34de736` VALUES (2, 11, 2, 24025, 24, 10021, 0.0, 0.0, 110501, "2030/12/17 14:59:59", 0.0, "カオリ（サマー）", "2019/07/31 12:00:00", "私の空手は世界最強さ～！\n夏の陽射しと青い海も合わされば、\n向かうところ敵なしだよー！");
